=head1 DESCRIPTION

Use to specify skipping a final backup, adding tags to a final backup,
or bypassing the retention period of an FSx for ONTAP SnapLock
Enterprise volume when deleting an FSx for ONTAP volume.

=head1 ATTRIBUTES


=head2 BypassSnaplockEnterpriseRetention => Bool

Setting this to C<true> allows a SnapLock administrator to delete an
FSx for ONTAP SnapLock Enterprise volume with unexpired write once,
read many (WORM) files. The IAM permission
C<fsx:BypassSnaplockEnterpriseRetention> is also required to delete
SnapLock Enterprise volumes with unexpired WORM files. The default
value is C<false>.

For more information, see Deleting a SnapLock volume
(https://docs.aws.amazon.com/fsx/latest/ONTAPGuide/snaplock-delete-volume.html).


=head2 FinalBackupTags => ArrayRef[L<Paws::FSX::Tag>]




=head2 SkipFinalBackup => Bool

Set to true if you want to skip taking a final backup of the volume you
are deleting.



